import React from "react";
import './ExpenseItems.css';

function ExpenseItems() {
  return <div>
    <div>
        March 28 2021
    </div>
    <div>
        <h2>Car Insurance</h2>
        <div>$281</div>
    </div>
  </div>;
}

export default ExpenseItems;
